import React, { Component } from 'react';

class Connexion extends Component {
    state = {
        pseudo : 'lkjk'
    }
    render() {
        return (
            <div className="connexionBox">
            <form className ='connexion'>
             <input 
             value = {this.state.pseudo}
             placeholder ="Pseudo"
             type="text"
             required/>
             <button type="submit">Go</button>
            </form>
         </div>
        );
    }
}

export default Connexion;
